import React from "react";

function About() {
  return (
    <div className="about">
      <div className="container">
        <div className="row align-items-center my-5">
          <div className="col-lg-5">
            <h1 className="font-weight-light">About</h1>
            <p>
              A brief history of this project
            </p>
            <br></br>
            <h1 className="font-weight-light">About</h1>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
